CREATE TABLE pedidos (
    id int primary key auto_increment,
    data date not null,
    data_confirmacao date not null,
    cliente_id int not null,
    funcionario_id int not null,
    CONSTRAINT `fk-cliente` FOREIGN KEY (`cliente_id`) REFERENCES `clientes` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
    CONSTRAINT `fk-funcionario` FOREIGN KEY (`funcionario_id`) REFERENCES `funcionarios` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

